import { BrowserRouter, Routes, Route } from 'react-router-dom';
import IndustryPage from './pages/industry';
import ThreatPage from './pages/threat';
import TeamPage from './pages/team';
import './App.css';
import Grid from '@mui/material/Grid';
import ResponsiveAppBar from './components/header'
import Box from '@mui/material/Box';
import Paper from "@material-ui/core/Paper";
import { makeStyles } from "@mui/material";
const useStyles = makeStyles(theme => ({
  app: {
    height: "calc(100vh - 200px)"
  }
}));

function App() {
  const classes = useStyles();
  return (
    <>
      <ResponsiveAppBar />
      <Paper className={classes.paper}>

        <Box sx={{ flexGrow: 1 }} >
          <Grid container spacing={2} style={{ margin: 15 }}>
            <BrowserRouter>
              <Routes>
                <Route index element={<IndustryPage />} />
                <Route path='industry' element={<IndustryPage />} />
                <Route path='team' element={<TeamPage />} />
                <Route path='threats' element={<ThreatPage />} />
              </Routes>
            </BrowserRouter>
          </Grid>

        </Box>
      </Paper>

      <div>
        <span>App: {process.env.REACT_APP_NAME} {process.env.REACT_APP_VERSION}</span>

      </div>
    </>
  );
}

export default App;
